import React from 'react';
import { View } from 'react-native';

const Obstacles = ({ obstacleLeft, obstacleHeight, obstacleWidth, gap }) => {
  return (
    <>
      <View
        style={{
          position: 'absolute',
          backgroundColor: 'green',
          width: obstacleWidth,
          height: obstacleHeight,
          left: obstacleLeft,
          bottom: 0 + obstacleHeight + gap,
        }}
      />

      <View
        style={{
          position: 'absolute',
          backgroundColor: 'green',
          width: obstacleWidth,
          height: obstacleHeight,
          left: obstacleLeft,
          bottom: 0,
        }}
      />
    </>
  );
};

export default Obstacles;
